import React from "react";
import '../index.css';
import Screen from "./Screen";


function Grid()
{
    function handleButtonClick(value) {
        handleScreenUpdate(value);
    }

   
    return (<div className='grid'>
    <button onClick={() => handleButtonClick("0")}>0</button>
    <button>1</button>
    <button>2</button>
    <button>3</button>
    <button>4</button>
    <button>5</button>
    <button>6</button>
    <button>7</button>
    <button>8</button>
    <button>9</button>
    <button>.</button>
    <button>%</button>
    <button>+</button>
    <button>*</button>
    <button>-</button>
    <button>/</button>
    <button>clr</button>
    <button>Ans</button>
    </div>
    );
}

export default Grid;
